    return(     

        <>
        <div className='IMGback'> 
        <h2 className='subject'>Home page</h2>
         
        <hr/>
        {/* <h2>API</h2> */}
{/*  راح يجيب المعلومات مباشره بعد تحديث الصفحه ussEffectال API ماعاد صت احتاج زر الضغط لافتح   */}
